import React from "react";
import "../App.css";
var WaterBottle = (Type) => {
  return (
    <div className="waterbottle">
      <img
        style={({ objectFit: "cover" }, { width: "80%" }, { height: "80%" })}
        src={require("../Image/" + Type + ".jpg")}
      ></img>
    </div>
  );
};

export default WaterBottle;
